Let's say we have a function that allows transfer of money, but no balance can be larger than or equal to 100. Let's see the contract and its associated check: pragma solidity ^0.8.19;
import "ds-test/test.sol"; contract MyContract is DSTest { mapping (address => uint) balances; function prove_add_value(address recv, uint amt) public { require(balances[recv] < 100); if (balances[recv] + amt > 100) { revert(); } balances[recv] += amt; assert(balances[recv] < 100); }
} Notice that this function has a bug: the require and the assert both check for <, but the if checks for >, which should instead be >=. Let's see if hevm can find this bug. In order to do that, we have to prepend the function name with prove_, which we did.

