Let's fix the above issue by incrementing the balance by 1 in case it's an odd value. Let's call this contract3.sol : //SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;
contract MyContract { mapping (address => uint) balances; function my_adder(address recv, uint amt) public { if (balances[recv] + amt >= 100) { revert(); } balances[recv] += amt/2; balances[recv] += amt/2; if (amt % 2 != 0) balances[recv]++; }
} Let's check whether this new contract is indeed equivalent: $ hevm equivalence \ --code-a $(solc --bin-runtime "contract1.sol" | tail -n1) \ --code-b $(solc --bin-runtime "contract3.sol" | tail -n1)
Found 108 total pairs of endstates
Asking the SMT solver for 74 pairs
Reuse of previous queries was Useful in 0 cases
No discrepancies found Hevm reports that the two are now equivalent, even though they clearly don't consume the same amount of gas and have widely different EVM bytecodes. Yet for an outside observer, they behave the same. Notice that hevm didn't simply fuzz the contract and within a given out of time it didn't find a counterexample. Instead, it proved the two equivalent from an outside observer perspective.
